import Following from '~/pages/Following';
import Home from '~/pages/Home';
import Profile from '../pages/Profile';
const publicRoutes = [
    { path: '/', component: Home },
    { path: '/Following', component: Following },
];
const privateRoutes = [];

export { publicRoutes, privateRoutes };
